import { StyleSheet} from 'react-native';

const style = StyleSheet.create({
    container:{
        flex: 1,
        alignItems: "center",
        justifyContent: 'center',
        paddingTop: 20,
        backgroundColor: '#000',
        width: '100%',
        height: '100%'

    },
    texto:{
        color: '#fff',
        fontSize: 30,
        fontFamily: 'monospace',
        fontWeight: 'bold'
    },
    inputLogin:{
        height: 40,
        width: '80%',
        margin: 10,
        borderBottomWidth: 0.5,
        borderBottomColor: '#fff',
        color:'##1C1C1C'
    }
})

export default style
